import {Navigate, Outlet} from "react-router-dom";


const PrivateRoutes = () => {
    const isAuthenticated = localStorage.getItem("accessToken") !== null;
    return(
        isAuthenticated? <Outlet/> : <Navigate to="/login"/>
    )
}

export default PrivateRoutes
